import React from "react";
import propTypes from "prop-types";

import * as Styled from "./style";
import Logo from "/assets/images/Logo.svg";

export const Size = {
  s: "20px",
  m: "24px",
  l: "28px",
};
export const Weight = {
  xs: 100,
  s: 300,
  m: 500,
  l: 700,
};

const Title = ({
  children,
  className = "",
  size = Size.s,
  weight = Weight.m,
}) => {
  const style = {
    fontSize: size,
    fontWeight: weight,
  };

  return (
    <Styled.Title className={className} style={style}>
      {children}
    </Styled.Title>
  );
};

Title.propTypes = {
  children: propTypes.node.isRequired,
  className: propTypes.string,
  Size: propTypes.string,
  Weight: propTypes.number,
};

export default Title;
